import { StyleSheet, Text, Dimensions } from 'react-native';
import {
  LineChart, 
} from 'react-native-chart-kit'
import React from 'react';

const Chart = () => {
  return (
    <LineChart
    data={{ 
      datasets: [
        {
          data: [
            Math.random() * 100,
            Math.random() * 100,
            Math.random() * 100, 
          ],
        },
      ],
    }}
    width={150} // from react-native
    height={150}  
    bezier  
  />
  );
};

export default Chart;

const styles = StyleSheet.create({});
